import React, { Component } from 'react';
import { Radio } from '@tableau/tableau-ui'


//let tempList = ['one', 'two', 'three'];
//
//{console.log('i: ', i)}
//<br/>

class RadioButton extends Component {
    state = { checkedValue: 'one' };
    onChange = (e) => this.setState({checkedValue: e.target.value});

    render () {
        //const { radioData } = this.props;
        //const { radioData } = tempList;
        //console.log('Debug radioData: ', radioData);

        return(
            <>
            {['one', 'two', 'three'].map( (radioOption, i) =>
                <React.Fragment key={i}>
                <Radio 
                    checked={this.state.checkedValue === {radioOption}} 
                    onChange={this.onChange} 
                    name='ordinal' 
                    value={radioOption}>
                    {radioOption}
                </Radio>
                </React.Fragment> 
            )}
            </>
        )
    }
}

export default RadioButton

